DROP DATABASE IF EXISTS images;

CREATE DATABASE images;

USE images;

CREATE TABLE deal_images (
id int NOT NULL AUTO_INCREMENT,
is_trending boolean NOT NULL default 0,
URL0 varchar(255) NOT NULL,
URL1 varchar(255),
URL2 varchar(255),
URL3 varchar(255),
URL4 varchar(255),
URL5 varchar(255),
URL6 varchar(255),
URL7 varchar(255),
URL8 varchar(255),
URL9 varchar(255), 
URL0a varchar(255), 
URL1a varchar(255),
URL2a varchar(255),
URL3a varchar(255),
URL4a varchar(255),
URL5a varchar(255),
URL6a varchar(255),
URL7a varchar(255),
URL8a varchar(255),
URL9a varchar(255), 
PRIMARY KEY (id)
);


